import React, { Component } from "react";
import "./App.css";
import Charts from './containers/Charts'

const charts = [
  {
    date: 1984,
    country: "UK",
    songs: [
      { name: "do be do", artist: "kylie" },
      { name: "song 2", artist: "danni" },
    ],
  },
];


class App extends Component {
  render() {
    return (
      <div className="App">
        App Container
        <Charts charts={charts} />
      </div>
    );
  }
}

export default App;
